import React from 'react'
import Footer from './Footer';
import NavBar from './NavBar';

const Cabinet = () => {
  return (
    <div>
        <NavBar/>
      <h2>It's Your Personal Cabinet</h2>
      <Footer/>
    </div>
  )
}

export default Cabinet
